import React from 'react';


// Рендер блока с карточкой
function RenderCard() {
  return (
    <div className="card-block">
      <div className="avatar"></div>
      <span className="first-name">Caresse</span>
      <span className="last-name">Hollow</span>
    </div>
  );
}


// Рендер главной страницы
function App() {
  return (
    <div>
      <div className="header">
        <h1>Карточки</h1>
      </div>

      <div className="cards">
        <RenderCard />
        <RenderCard />
        <RenderCard />
        <RenderCard />
        <br/>
        <RenderCard />
        <RenderCard />
        <RenderCard />
        <RenderCard />
        <br/>
        <RenderCard />
        <RenderCard />
        <RenderCard />
        <RenderCard />
      </div>
    </div>
  );
}

export default App;
